CREATE TABLE [Categories] ([Category ID] int NOT NULL   IDENTITY (1,1)
, [Category Name] nvarchar(15) NOT NULL  
, [Description] ntext NULL   
, [Picture] image NULL   
);
CREATE TABLE [Customers] ([Customer ID] nvarchar(5) NOT NULL  
, [Company Name] nvarchar(40) NOT NULL  
, [Contact Name] nvarchar(30) NULL  
, [Contact Title] nvarchar(30) NULL  
, [Address] nvarchar(60) NULL  
, [City] nvarchar(15) NULL  
, [Region] nvarchar(15) NULL  
, [Postal Code] nvarchar(10) NULL  
, [Country] nvarchar(15) NULL  
, [Phone] nvarchar(24) NULL  
, [Fax] nvarchar(24) NULL  
);
CREATE TABLE [Employees] ([Employee ID] int NOT NULL   IDENTITY (1,1)
, [Last Name] nvarchar(20) NOT NULL  
, [First Name] nvarchar(10) NOT NULL  
, [Title] nvarchar(30) NULL  
, [Birth Date] datetime NULL   
, [Hire Date] datetime NULL   
, [Address] nvarchar(60) NULL  
, [City] nvarchar(15) NULL  
, [Region] nvarchar(15) NULL  
, [Postal Code] nvarchar(10) NULL  
, [Country] nvarchar(15) NULL  
, [Home Phone] nvarchar(24) NULL  
, [Extension] nvarchar(4) NULL  
, [Photo] image NULL   
, [Notes] ntext NULL   
, [Reports To] int NULL   
);
CREATE TABLE [Order Details] ([Order ID] int NOT NULL   
, [Product ID] int NOT NULL   
, [Unit Price] money NOT NULL   
, [Quantity] smallint NOT NULL   
, [Discount] real NOT NULL   
);
CREATE TABLE [Orders] ([Order ID] int NOT NULL   
, [Customer ID] nvarchar(5) NOT NULL  
, [Employee ID] int NULL   
, [Ship Name] nvarchar(40) NULL  
, [Ship Address] nvarchar(60) NULL  
, [Ship City] nvarchar(15) NULL  
, [Ship Region] nvarchar(15) NULL  
, [Ship Postal Code] nvarchar(10) NULL  
, [Ship Country] nvarchar(15) NULL  
, [Ship Via] int NULL   
, [Order Date] datetime NULL   
, [Required Date] datetime NULL   
, [Shipped Date] datetime NULL   
, [Freight] money NULL   
);
CREATE TABLE [Products] ([Product ID] int NOT NULL   IDENTITY (1,1)
, [Supplier ID] int NULL   
, [Category ID] int NULL   
, [Product Name] nvarchar(40) NOT NULL  
, [English Name] nvarchar(40) NULL  
, [Quantity Per Unit] nvarchar(20) NULL  
, [Unit Price] money NULL   
, [Units In Stock] smallint NULL   
, [Units On Order] smallint NULL   
, [Reorder Level] smallint NULL   
, [Discontinued] bit NOT NULL   
);
CREATE TABLE [Shippers] ([Shipper ID] int NOT NULL   IDENTITY (1,1)
, [Company Name] nvarchar(40) NOT NULL  
);
CREATE TABLE [Suppliers] ([Supplier ID] int NOT NULL   IDENTITY (1,1)
, [Company Name] nvarchar(40) NOT NULL  
, [Contact Name] nvarchar(30) NULL  
, [Contact Title] nvarchar(30) NULL  
