Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('2','Fuller','Andrew','Vice President, Sales','19-02-1942 00:00:00','12-07-1991 00:00:00','908 W. Capital Way','Tacoma','WA','98401','USA','(206) 555-9482','3457','System.Byte[]','Andrew received his BTS commercial in 1964 and an MBA in International Marketing from the University of Dallas in 1971.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative, was promoted to sales manager in January 1992 and to vice president of sales in March 1993.  Andrew is a member of the Sales Management Roundtable, the Seattle Chamber of Commerce, and the Pacific Rim Importers Association.',null);
Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('3','Leverling','Janet','Sales Representative','30-08-1963 00:00:00','27-02-1991 00:00:00','722 Moss Bay Blvd.','Kirkland','WA','98033','USA','(206) 555-3412','3355','System.Byte[]','Janet has a BS degree in Chemistry from Boston College (1984).  She has also completed a certificate program in Food Retailing Management.  Janet was hired as a sales associate in 1991 and promoted to sales representative in February 1992.','2');
Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('4','Peacock','Margaret','Sales Representative','19-09-1937 00:00:00','30-03-1992 00:00:00','4110 Old Redmond Rd.','Redmond','WA','98052','USA','(206) 555-8122','5176','System.Byte[]','Margaret holds a BA in English literature from Concordia College (1958) and an MA from the American Institute of Culinary Arts (1966).  She was assigned to the London office temporarily from July through November 1992.','2');
Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('5','Buchanan','Steven','Sales Manager','04-03-1955 00:00:00','13-09-1992 00:00:00','14 Garrett Hill','London',null,'SW1 8JR','UK','(71) 555-4848','3453','System.Byte[]','Steven Buchanan graduated from St. Andrews University, Scotland, with a BSC degree in 1976.  Upon joining the company as a sales representative in 1992, he spent 6 months in an orientation program at the Seattle office and then returned to his permanent post in London.  He was promoted to sales manager in March 1993.  Mr. Buchanan has completed courses in Successful Telemarketing and International Sales Management.  He is fluent in French.','2');
