Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('8','Callahan','Laura','Inside Sales Coordinator','09-01-1958 00:00:00','30-01-1993 00:00:00','4726 - 11th Ave. N.E.','Seattle','WA','98105','USA','(206) 555-1189','2344','System.Byte[]','Laura received a BA in psychology from the University of Washington.  She has also completed a course in business French.  She reads and writes French.','2');
