Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('10','Hellstern','Albert','Business Manager','13-03-1960 00:00:00','01-03-1993 00:00:00','13920 S.E. 40th Street','Bellevue','WA','98006','USA','(206) 555-4869','7559','System.Byte[]','Albert Hellstern is a graduate of Harvard University, where he earned a Bachelor of Science degree in 1981; he also holds a Master''s Degree in International Studies from Stanford University (1985).  Mr. Hellstern was hired as Assistant Business Manager in 1993 and was promoted to Business Manager shortly thereafter.  Although Mr. Hellstern is a native speaker of English, he speaks German, French and Spanish with equal fluency.  Mr. Hellstern has travelled extensively in South America and is responsible for establishing our company''s presence there.','2');
Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('11','Smith','Tim','Mail Clerk','06-06-1973 00:00:00','15-01-1993 00:00:00','30301 - 166th Ave. N.E.','Kent','WA','98042','USA','(206) 555-3857','6261','System.Byte[]','Tim Smith graduated from Mariner High School and is currently taking evening classes at a local Community College.  He hopes to obtain his AA degree in programming in June 1994 and will then continue his education at the University of Washington in Seattle.  He plans a career as Programmer/Analyst with a local software company.','3');
Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('12','Patterson','Caroline','Receptionist','11-09-1972 00:00:00','15-05-1993 00:00:00','16 Maple Lane','Auburn','WA','98002','USA','(206) 555-3487','1411','System.Byte[]','Caroline Patterson graduated from Tahoma High School and has an  AA degree from Bellevue Community College in Bellevue, Washington; she is currently participating in the International Trade Series there. She intends to continue her education and expects to earn a  Master''s degree in the future.','3');
Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('13','Brid','Justin','Marketing Director','08-10-1962 00:00:00','01-01-1994 00:00:00','2 impasse du Soleil','Haguenau','Bas-Rhin','67500','France','88 83 83 16','377','System.Byte[]','Justin Brid graduated from HEC Paris (Hautes Etudes Commerciales de Paris) in 1986 with high honors. Mr. Brid attended the American Graduate School of International Management (Thunderbird) in Glendale, Arizona.  Prior to his employment with Northwind Traders, he held positions with several  Import/Export companies (Culinary Specialties) in Germany, Switzerland, and Austria. Mr. Brid is equally fluent in French and German; he also speaks English and reads Spanish.','2');
Insert Into [Employees] ([Employee ID],[Last Name],[First Name],[Title],[Birth Date],[Hire Date],[Address],[City],[Region],[Postal Code],[Country],[Home Phone],[Extension],[Photo],[Notes],[Reports To]) Values ('14','Martin','Xavier','Marketing Associate','30-11-1960 00:00:00','15-01-1994 00:00:00','9 place de la Libert?','Schiltigheim','Bas-Rhin','67300','France','88 62 43 53','380','System.Byte[]','Xavier Martin is a graduate of the University of Chicago (BA) and the ESC Bordeaux (Ecole Sup?rieure de Commerce de Bordeaux).  Mr. Martin has travelled widely in Eastern Europe, most recently in the Czech Republic, Poland, and Hungary for purposes of establishing a network of contacts for future sales activities. Mr. Martin is completely fluent in German and French (he is a native speaker of both languages); he also speaks English and understands Polish.','13');
